import React from 'react'


const VideoContainer = () => {
  return (
    <Box component='div' sx={{display:'flex', width:'100%'}}>
        <Box component='a' href='https://www.pacomartinez.com/es/rebajas.html'>
            <Box component='img' src='https://i.pinimg.com/originals/d5/61/e5/d561e57b6b0f0186c5d0cdf0a59d1f68.jpg' sx={{display:'flex',width:'100%', height:'100%'}}></Box>
        </Box>
        
    </Box>
  )
}

export default VideoContainer
